import { config } from "./config"
import { editor } from "./editor"
import { files } from "./files"
import "./index.css"

const setWindowSize = () => {
  console.log(`sdfskdhfkhsdfhdsa`)
  window.data.editor.width = window.innerWidth
  window.data.editor.height = window.innerHeight
  window.data.editor.reload()
}

const setUp = () => {
  if(window.data) {
    return
  }

  window.data = { config, files, editor }

  document.addEventListener(`resize`, setWindowSize)

  //window.onresize = setWindowSize
}

setUp()
